import Button from "./Button";
const App= ()=> {
    return <div>
      <h1>Useful websites in single page.</h1>
      <h3>Browse any website you want.</h3>
     <Button name="Google"/>
     <Button name="Facebook"/>
     <Button name="Youtube"/>
     <Button name="LinkedIn"/>
     <Button name="Instagram"/>
    </div>
  }
  export default App;
